  input: TEXT,F3A,,"In response to your letter dated January 11, 2005 regarding the
    30 Day Post General Report please note that Line 12 of the detailed summary page
    shows $90,589.00 in transfers and all had been reported on a supporting schedule
    A in the original filing.  You have stated that the Committee failed to file three
    48-hour notices, however the committee did file those notices on 10/25/04 and
    they appear for public inspection on the Commission website.  You have asked that
    the Committee provide best efforts information.  The Committee follows all Commission
    guidelines regarding the gathering and reporting of best efforts information.  The
    original solicitation includes a clear and conspicuous request for the information
    and informs the contributor of the law.  If the information is not provided, a
    second request is sent explaining the law and asking the contributor to provide
    the information and return it in a pre-stamped, pre-addressed envelope.  There
    is no solicitation in this second request.  When information is received, the
    Committee includes the upodated information in our next regularly scheduled report
    or amends the original filing.  The two disbursements on schedule B missing the
    purpose; Jamestown Associates and Richard Renzi, have been amended to include
    the purpose.  Please contact me if you have any further questions.  Thank you."
